let restrictCodigo = false;
let restrictEditCodigo = true;

let restrictCategoria = false;
let restrictEditCategoria = true;

let restrict = false;
let restrictEdit = true;


function valCodigo(){
      let pattern=/^[0-9]{4}/;
      let campo = document.getElementById('codigo');
     
      let result = pattern.test(campo.value);
      restrictCodigo = result;
      restrictEditCodigo = result;
      if(result === false){
        $("#codigo").css("border-bottom","2px solid #f27474");

        Swal.fire(
                'Advertencia',
                'Solo puedes introducir un codigo con 4 digitos.',
                'warning'
              ).then(function(){
                campo.value='';
              });
      }
      else{
        /*$("#codigo").css("border-bottom","2px solid #6acfff");*/
           /* $("#cedula").css("border-bottom","2px solid #6acfff");*/
           $.post("../modelo/modulo_proyecto.php",{
            siCampoExiste: '',
            tabla: 'insumos',
            campo: 'CODIGO',
            dato: campo.value
          },function(data){
            datos= JSON.parse(data);

              if(datos.existe==='1'){

                restrictCodigo = false;
                restrictEditCodigo= false;

                $("#codigo").css("border-bottom","2px solid #f27474");
              
                Swal.fire(
                'Advertencia',
                'El codigo ya esta asignado a otro Insumo.',
                'warning'
              ).then(function(){
                campo.value='';
              });
            }
            else {
            $("#codigo").css("border-bottom","2px solid #6acfff");
            restrictCodigo = true;
            restrictEditCodigo= true;

          }
      });
      }
  }



  function valNombre(){

    if(document.getElementById("nombre").value.length===0){

      $("#nombre").css("border-bottom","2px solid #f27474");
      
      tippy('#nombre', {
          content: "Introduce un nombre valido",
          trigger: 'focus',
          animation: 'fade',
        });

    } else {
      $("#nombre").css("border-bottom","2px solid #6acfff");
    }
  
  }



  function valCategoria(){
      let pattern=/[^^`¿?)(&%$·"!!ª,.[\]´ç`+\n]*/;
      let campo = document.getElementById('categoria');
      let result = pattern.test(campo.value);
      restrictCategoria = result;
      restrictEditCategoria = result;
      if(result === false){
        $("#categoria").css("border-bottom","2px solid #f27474");
        
        Swal.fire(
                'Advertencia',
                'Introduce una categoria existente',
                'warning'
              ).then(function(){
                campo.value='';
              });

      } 
      else{
      $("#categoria").css("border-bottom","2px solid #6acfff");
      $.post("../../Modelo/modulo_proyecto.php",{
      siCampoExiste: '',
      tabla: 'CATEGORIA',
      campo: 'NOMBRE',
      dato: document.getElementById('categoria').value

    },function(data){

      datos= JSON.parse(data);

        if(datos.existe==='0'){

          restrictCategoria = false;
          restrictEditCategoria = false;

          $("#categoria").css("border-bottom","2px solid #f27474");
        
          Swal.fire(
                'Advertencia',
                'Introduce una categoria existente.',
                'warning'
              ).then(function(){
                campo.value='';
              });

      } 
      else {

        restrictCategoria = true;
        restrictEditCategoria = true;

      $("#categoria").css("border-bottom","2px solid #6acfff");

    }
});

      }
  }

  function valProveedor(){
      $.post("../../Modelo/modulo_proyecto.php",{
      siCampoExiste: '',
      tabla: 'PROVEEDOR',
      campo: 'NOMBRE',
      dato: document.getElementById('proveedor').value
    },function(data){

      datos= JSON.parse(data);

        if(datos.existe==='0'){
          restrict = false;

          $("#proveedor").css("border-bottom","2px solid #f27474");
           
