function borrar(id) {

Swal.fire({
title: 'deshabilitar el Producto',
text: "Seguro que quieres desabilitar este Producto",
icon: 'warning',
showCancelButton: true,
confirmButtonColor: '#3085d6',
cancelButtonColor: '#d33',
confirmButtonText: 'Si!',
cancelButtonText: "Cancelar"
}).then((result) => {
if (result.isConfirmed) {
  Swal.fire(
    'Deshabilitado!',
    'El Producto se ha deshabilitado.',
    'success'
  ).then(function(){ 
    window.location.href="productos.php?user=&deshabilitar=0&id="+ id;
 }
  );
}
})

}



function habilitar(id) {

Swal.fire({
title: 'Habilitar el Producto',
text: "Seguro que quieres Habilitar este Producto",
icon: 'warning',
showCancelButton: true,
confirmButtonColor: '#3085d6',
cancelButtonColor: '#d33',
confirmButtonText: 'Si!',
cancelButtonText: "Cancelar"
}).then((result) => {
if (result.isConfirmed) {
  Swal.fire(
    'Deshabilitado!',
    'El Producto se ha Habilitado.',
    'success'
  ).then(function(){ 
    window.location.href="productos.php?user=&habilitar=0&id="+ id;
 }
  );
}
})

}


function agregar() {

if(restrictCodigo===true && restrictCategoria===true){
 restrict=true;
}else{
  restrict=false;
}

if (restrict===true && document.getElementById("categoria").value.length>0 && document.getElementById("codigo").value.length>0 && document.getElementById("nombre").value.length>0){
$.post("insumos.php",{
agregar_inv: "",
categoria: document.getElementById('categoria').value,
codigo: document.getElementById('codigo').value,
