  )
}

}

function editar(xid) {

  if(restrictEditCodigo===true && restrictEditCategoria===true){
  restrictEdit=true
}else{
  restrictEdit=false;
}

if (restrictEdit===true && document.getElementById("categoria").value.length>0 && document.getElementById("codigo").value.length>0 && document.getElementById("nombre").value.length>0){
$.post("insumos.php",{
save_inv: "",
id: xid,
categoria: document.getElementById('categoria').value,
existencia: document.getElementById('existencia').value,
codigo: document.getElementById('codigo').value,
nombre: document.getElementById('nombre').value,
precio: document.getElementById('precio').value,
almacen: document.getElementById('almacen').value,
c_min: document.getElementById('c_min').value,
